
import os
import json
import base64
import hashlib
import requests
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from Crypto.Cipher import PKCS1_OAEP
from datetime import datetime

# Fonction pour dechiffrer une cle AES avec RSA
def decrypt_key_with_rsa(encrypted_key, private_key):
    encrypted_key = base64.b64decode(encrypted_key.encode())
    cipher = PKCS1_OAEP.new(private_key)
    decrypted_key = cipher.decrypt(encrypted_key)
    return decrypted_key

# Fonction pour dechiffrer les donnees
def decrypt_data(encrypted_data, key):
    try:
        encrypted_data = base64.b64decode(encrypted_data.encode())
        iv = encrypted_data[:16]
        ct = encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        pt = unpad(cipher.decrypt(ct), AES.block_size)
        return pt.decode()
    except (ValueError, KeyError) as e:
        print(f"‚ùå Erreur lors du dechiffrement : {e}")
        return None

# Charger les metadonnees
metadata_file = "IPToP#1.4a.py_encrypted.metadata.json"
with open(metadata_file, 'r') as file:
    metadata = json.load(file)

# Charger la cle privee RSA
with open("private_key.pem", 'r') as file:
    private_key = RSA.import_key(file.read())

# Dechiffrer la cle AES
key = decrypt_key_with_rsa(metadata["encrypted_key"], private_key)

# Donnees chiffrees
ENCRYPTED_SCRIPT = """"""

# Dechiffrer le script
decrypted_script = decrypt_data(ENCRYPTED_SCRIPT, key)

if decrypted_script:
    # Verifier la date d'expiration
    expiration_date = datetime.strptime(metadata["expiration_date"], "%Y-%m-%d")
    if datetime.now() > expiration_date:
        print("‚ùå Le script a expire.")
    else:
        # Executer le script dechiffre
        exec(decrypted_script)
